import Link from 'next/link';
import Nav from './Nav';
import styled from 'styled-components';

const Logo = styled.h1`
    background: red;
    font-size: 4rem;
    margin-left: 2rem;
    position: relative;
    z-index: 2;
    transform: skew(-7deg);
    a {
        color: white;
        text-decoration: none;

    }
`;

export default function Header() {
    return (
        <header>
            <div className="bar">
                <Logo>
                    <Link href="/">SickFits</Link>
                </Logo>
            </div>
            <Nav />
            <div className="sub-bar">
                <p>SEARCHY SEARCHY</p>
            </div>
        </header>
    );
}
